import React, { useState } from 'react';
import './Emp.css';


function Emp() {
  const [selectedOption, setSelectedOption] = useState(null);
  const [nominees, setNominees] = useState([]);

  const handleAdd = () => {
    setSelectedOption('add');
  };

  const handleRemove = () => {
    setSelectedOption('remove');
  };

  const handleBack = () => {
    setSelectedOption(null);
  };

  const handleAddNominee = (name, relation) => {
    setNominees([...nominees, { name, relation }]);
  };

  const handleRemoveNominee = (index) => {
    setNominees(nominees.filter((_, i) => i !== index));
  };

  return (
    <div>
      {selectedOption === null && (
        <div>
          <button onClick={handleAdd}>Add</button>
          <button onClick={handleRemove}>Remove</button>
        </div>
      )}
      {selectedOption === 'add' && (
        <AddForm onAdd={handleAddNominee} onBack={handleBack} />
      )}
      {selectedOption === 'remove' && (
        <RemoveForm nominees={nominees} onRemove={handleRemoveNominee} onBack={handleBack} />
      )}
    </div>
  );
}


function AddForm({ onAdd, onBack }) {
  const [nomineename, setnomineename] = useState('');
  const [relation, setRelation] = useState('');

  const handleRelationChange = (event) => {
    setRelation(event.target.value);
  };
  return (
    <div className="nominee-container">
              <div className='wrap'>
        <h1>Secure Your Loved Ones</h1>
        <h2>Add family members to ensure their well-being under our comprehensive health policy. Provide them with the peace of mind and robust protection they deserve, ensuring a healthy and happy life for all your cherished ones. <br/><br/>Together, letâ€™s build a healthier tomorrow for you and your family, safeguarding what matters most.</h2>

        </div>
        <div className="nm-box nm-box1">
        <video src='/videos/video-11.mp4' autoPlay loop muted />
        </div>
        <div className="nm-box nm-box2">
          <form className="nominee-form">
            <div className="form-group">
            <input type="text"
                  placeholder="Nominee Name"
                  value={nomineename}
                  onChange={(e) => setnomineename(e.target.value)}
                  required />
            </div>
            <div className="form-group">
        <select id="relation" value={relation} onChange={handleRelationChange}>
        <option value="" disabled>Select Relation</option>
        <option value="Father">Father</option>
        <option value="Mother">Mother</option>
        <option value="Spouse">Spouse</option>
        <option value="Child">Child</option>
      </select>
            </div>
            <button type="submit" className="submit-button">Add Nominee</button>
          </form>
        </div>
        <div className="nm-box nm-box3"></div>
        <div className="nm-box nm-box4"></div>
        <div className="nm-box nm-box5">
          <div className='gdknw'>
          <h2>Eligibility: </h2>
<h3>Immediate family members such as spouse, children, parents, and in-laws can be added as nominees.
      Nominees must meet specific criteria outlined in the policy terms.</h3>
          </div>
        </div>
    </div>
  );
};

function RemoveForm({ nominees, onRemove, onBack }) {
  return (
    <div>
      <button onClick={onBack}>Back</button>
      {nominees.map((nominee, index) => (
        <div key={index}>
          <input type="checkbox" checked={false} onChange={() => onRemove(index)} />
          <label>{nominee.name}</label>
        </div>
      ))}
      <button>Remove Selected</button>
    </div>
  );
}


export default Emp;
